import React, {useEffect, useState} from 'react';
import { Photos } from './import';
import "./Library.css";

const Library = () => {

    const [displayFlug, setDisplayFlug] = useState<boolean>(false);

    const display = (value: number) => {
        return ()=> {
            setDisplayFlug(true);
        }
    }

    useEffect(() => {
        if(displayFlug){
            setDisplayFlug(true);
        }
    }, [displayFlug])

  return (
    <>
        <h2>Library</h2>
        <div className="wrapper">
            <div className='photo'>
                <img src={Photos[0]} alt="" onClick={display(0)}/>
            </div>
            <div className='photo'>
                <img src={Photos[1]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[2]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[3]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[4]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[5]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[6]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[7]} alt="" />
            </div>
            <div className='photo'>
                <img src={Photos[8]} alt="" />
            </div>
        </div>
    </>
  )
}

export default Library
